using System;
using System.Threading.Tasks;

namespace Mitten.Mobile.Devices
{
    /// <summary>
    /// A simulated camera device meant to be used when running the application in a simulator.
    /// </summary>
    public class SimulatedCameraDevice : ICameraDevice
    {
        private readonly Func<Task<bool>> requestAccess;
        private readonly bool isDefective;

        private CameraPermission cameraPermission;
        private CameraFlashMode cameraFlashMode;
        private bool isFlashAvailable;
        private bool isCameraOn;

        /// <summary>
        /// Initializes a new instance of the <see cref="SimulatedCameraDevice"/> class.
        /// </summary>
        /// <param name="cameraPermission">The camera permissions to use for the simulated camera.</param>
        /// <param name="isDefective">True to simulate a defective camera, other false.</param>
        /// <param name="isFlashAvailable">True to simulate that the flash is available.</param>
        /// <param name="requestAccess">Requests user access to the camera.</param>
        public SimulatedCameraDevice(
            CameraPermission cameraPermission, 
            bool isDefective,
            bool isFlashAvailable,
            Func<Task<bool>> requestAccess)
        {
            this.cameraPermission = cameraPermission;
            this.isDefective = isDefective;
            this.isFlashAvailable = isFlashAvailable;
            this.requestAccess = requestAccess;

            this.cameraFlashMode = CameraFlashMode.On;
        }

        /// <summary>
        /// Gets the current authorization permissions for the camera.
        /// </summary>
        public CameraPermission GetPermission()
        {
            return this.cameraPermission;
        }

        /// <summary>
        /// Gets whether or not the camera for the current device is on and ready to capture an image.
        /// </summary>
        public bool IsCameraOn()
        {
            return this.isCameraOn;
        }

        /// <summary>
        /// Gets whether or not the camera has a flash.
        /// </summary>
        /// <returns>True if the camera flash is supported, otherwise false.</returns>
        public bool IsFlashAvailable()
        {
            return this.isFlashAvailable;
        }

        /// <summary>
        /// Gets the current mode of the camera's flash.
        /// </summary>
        /// <returns>The current flash mode.</returns>
        public CameraFlashMode GetCurrentFlashMode()
        {
            return 
                !this.isFlashAvailable 
                ? CameraFlashMode.NotAvailable 
                : this.cameraFlashMode;

        }

        /// <summary>
        /// Sets the camera's flash mode.
        /// </summary>
        /// <param name="flashMode">The mode to set.</param>
        public void SetFlashMode(CameraFlashMode flashMode)
        {
            if (!this.isFlashAvailable)
            {
                throw new InvalidOperationException("Cannot set the flash mode, flash is not available.");
            }

            this.cameraFlashMode = flashMode;
        }

        /// <summary>
        /// Requests user access to the device.
        /// </summary>
        /// <returns>True if access was granted, otherwise false.</returns>
        public Task<bool> RequestAccessAsync()
        {
            return 
                this.requestAccess()
                .ContinueWith(task =>
                {
                    this.cameraPermission =
                        task.Result
                        ? CameraPermission.Authorized
                        : CameraPermission.Denied;

                    return task.Result;
                });
        }

        /// <summary>
        /// Begins starting the camera.
        /// </summary>
        /// <param name="cameraStarted">Invoked when the camera has been started.</param>
        public void BeginStartCamera(Action<object> cameraStarted)
        {
            if (this.GetPermission() != CameraPermission.Authorized)
            {
                throw new InvalidOperationException("Camera access not authorized (" + this.GetPermission() + ").");
            }

            if (this.isCameraOn)
            {
                throw new InvalidOperationException("The camera is already on.");
            }

            this.isCameraOn = true;
            cameraStarted(null);
        }

        /// <summary>
        /// Stops the camera.
        /// </summary>
        public void StopCamera()
        {
            if (!this.IsCameraOn())
            {
                throw new InvalidOperationException("The camera has not been started.");
            }

            this.isCameraOn = false;
        }

        /// <summary>
        /// Begins capturing an image from the camera.
        /// </summary>
        /// <param name="imageCaptured">Invoked when an image has been captured.</param>
        /// <param name="captureFailed">Invoked when a failure occured while trying to capture an image.</param>
        public void BeginCaptureImage(Action<byte[]> imageCaptured, Action<string> captureFailed)
        {
            if (this.isDefective)
            {
                captureFailed("Defective");
            }
            else
            {
                imageCaptured(SimulatedCameraDevice.GetSampleImage());
            }
        }

